import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

import axios from 'axios';
import deleteVehicle from './DeleteVehicle';

export default function AllVehicle() {
  const [vehicle, setVehicles] = useState([]);

  const getVehicle = () => {
    axios.get('http://localhost:6060/Vehicle/')
      .then((res) => {
        console.log(res.data);
        setVehicles(res.data);
      })
      .catch((err) => {
        alert(err.message);
      });    
      
  };

  

  useEffect(() => {
    getVehicle();
    
  }, []);

  const handleDelete = (vehicleId) => {
    deleteVehicle(vehicleId)
      .then(() => {
        alert('Vehicle deleted successfully');
        getVehicle();
      })
      .catch((err) => {
        alert('Vehicle not deleted: ' + err);
      });
  };

  

  return (
    <div style={{ flex: '1', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
    <div style={{ overflowX: 'auto', maxWidth: 'calc(100% - 250px)', padding: '20px' }}>
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: 'auto', backgroundColor: '#f0f0f0', padding: '20px' }}>
    <h1 style={{ marginLeft: '-200px' }}>All Vehicles</h1>
    <div style={{ overflowX: 'auto', marginLeft: '130px', maxHeight: '500px' }}>
      <table style={{ borderCollapse: 'collapse', width: '100%', border: '1px solid #ddd', borderRadius: '5px' }}>
        <thead style={{ backgroundColor: '#f0f0f0', borderBottom: '2px solid #ddd' }}>
          <tr>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Reg Number</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Brand</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Model</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Available</th>
            <th style={{ padding: '12px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Price Per Day</th>
            <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>View</th>
            <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Delete</th>
            <th style={{ padding: '5px', textAlign: 'left', borderBottom: '1px solid #ddd' }}>Update</th>
          </tr>
        </thead>
        <tbody style={{ maxHeight: '500px' }}>
          {vehicle.map((v, index) => (
            <tr key={index} style={{ borderBottom: '1px solid #ddd' }}>
              <td style={{ padding: '12px' }}>{v.regnumber}</td>
              <td style={{ padding: '12px' }}>{v.brand}</td>
              <td style={{ padding: '12px' }}>{v.model}</td>
              <td style={{ padding: '12px' }}>{v.available}</td>
              <td style={{ padding: '12px' }}>Rs: {v.priceperday}</td>
              <td style={{ padding: '5px', textAlign: 'center' }}>
                <img
                  src={`http://localhost:6060/images/eye.png`}
                  alt={`${index}`}
                  style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer', marginRight: '5px' }}
                  onClick={() => handleDelete(v._id)}
                />
              </td>
              <td style={{ padding: '5px', textAlign: 'center' }}>
                <img
                  src={`http://localhost:6060/images/delete.png`}
                  alt={`${index}`}
                  style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer', marginRight: '5px' }}
                  onClick={() => handleDelete(v._id)}
                />
              </td>
              <td style={{ padding: '5px', textAlign: 'center' }}>
                <a className="nav-link" href={`/update/${v._id}`}>
                  <img
                    src={`http://localhost:6060/images/edit.png`}
                    alt={`${index}`}
                    style={{ width: '20px', height: '20px', objectFit: 'cover', cursor: 'pointer' }}
                  />
                </a>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  </div>
  </div>
  </div>
  


  );
}
